  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-size: 100.23% !important;
      line-height: 175.25% !important;
    }

    ul {
      list-style-type: none
    }

    img {
      max-width: 100%
    }

    body {
      font-family: Arial, sans-serif;
      font-size: 13px;
      background: #050505;
      color: #f4f4f4;
      margin: 0 auto;
      padding-bottom: 60px;
      max-width: 600px
    }

    .header {
      background: #1a1a1a;
      width: 100%;
      margin: 0 auto
    }

    .header__wrapper {
      height: 48px;
      position: relative;
      display: flex;
      justify-content: center;
      align-items: center
    }

    .header__logo {
      text-transform: uppercase;
      font-weight: 900;
      font-size: 1.5em !important
    }

    .header__logo span {
      color: #ae1a20
    }

    .header__menu {
      position: absolute;
      top: 50%;
      transform: translateY(-50%);
      left: 0;
      margin: 0 10px;
      display: flex;
      flex-direction: column;
      gap: 8px;
      width: 24px
    }

    .header__menu span {
      width: 100%;
      background: #fff;
      height: 2px
    }

    .nav__list {
      display: flex
    }

    .nav__item {
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 5px;
      background-color: #151515;
      text-align: center;
      border: 1px solid #444;
      flex: 1 1 auto;
      height: 30px;
      font-size: 11px
    }

    .header__tags-wrapper {
      padding: 15px 10px;
      max-width: 100%;
      overflow-x: auto;
      display: flex;
      gap: 10px;
      scrollbar-width: thin;
      scrollbar-color: transparent transparent
    }

    .header__tags-wrapper::-webkit-scrollbar {
      width: 0;
      height: 0
    }

    .header__tags-item {
      flex: 0 0 auto;
      height: 30px;
      border: 1px solid #505050;
      border-radius: 3px;
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 0 20px
    }

    .main {
      padding: 0 5px;
      display: flex;
      flex-direction: column;
      min-height: calc(100vh - 200px)
    }

    .main__title {
      margin: 20px 0;
      padding: 0 5px;
      font-weight: 600;
      font-size: 15px
    }

    .main__item {
      flex: 1 1 auto;
      display: flex;
      flex-direction: column
    }

    .main__item .item__image {
      width: 100%;
      position: relative;
      margin-bottom: 5px;
      overflow: hidden;
      flex: 1 1 auto;
      min-height: 250px
    }

    .main__item .item__image:before {
      content: '';
      background: -moz-linear-gradient(to bottom, rgba(0, 0, 0, 0), rgba(0, 0, 0, .7));
      background: -webkit-linear-gradient(to bottom, rgba(0, 0, 0, 0), rgba(0, 0, 0, .7));
      background: -o-linear-gradient(to bottom, rgba(0, 0, 0, 0), rgba(0, 0, 0, .7));
      background: -ms-linear-gradient(to bottom, rgba(0, 0, 0, 0), rgba(0, 0, 0, .7));
      background: linear-gradient(to bottom, rgba(0, 0, 0, 0), rgba(0, 0, 0, .7));
      width: 100%;
      position: absolute;
      height: 30%;
      bottom: 0;
      left: 0
    }

    .main__item .item__image .image-wrapper {
      position: absolute;
      width: 100%;
      height: 100%;
      background-position: center center;
      background-repeat: no-repeat;
      background-size: cover;
      filter: blur(30px)
    }

    .main__item .item__info {
      position: absolute;
      top: 0;
      right: 0;
      padding: 3px 5px;
      width: 100%;
      box-sizing: border-box;
      text-align: right;
      left: 0;
      z-index: 1;
      color: #fff;
      line-height: 1;
      display: flex;
      justify-content: flex-end;
      align-items: center;
      gap: 5px;
      font-size: 12px
    }

    .main__item .item__quality {
      font-weight: 600
    }

    .main__item .item__content {
      display: flex;
      flex-wrap: wrap;
      justify-content: space-between;
      gap: 5px;
      font-size: 12px
    }

    .main__item .item__title {
      white-space: nowrap;
      overflow: hidden;
      text-overflow: ellipsis;
      font-size: 12px;
      width: 100%
    }

    .main__item .item__views {
      width: calc(100% - 40px);
      color: #bbb
    }

    .main__item .item__rating {
      width: 30px;
      color: #bbb
    }

    .main__item .item__channel {
      width: 100%
    }

    .nav-menu {
      position: fixed;
      z-index: 9;
      bottom: 0;
      left: 50%;
      transform: translateX(-50%);
      width: 100%;
      max-width: 600px;
      background: #1a1a1a
    }

    .nav-menu__list {
      display: flex;
      padding: 0 20px
    }

    .nav-menu__item {
      display: flex;
      height: 55px;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      gap: 3px;
      width: 25%;
      font-size: 10px
    }

    .nav-menu__item:not(.item--active) {
      color: #bbb
    }

    .pl {
      display: flex;
      flex-grow: 1;
      margin-top: 10px;
      min-height: 212px;
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: 2
    }

    .pl__cnt {
      background-size: contain;
      background-position: center center;
      background-repeat: no-repeat;
      flex-grow: 1
    }

    .pl__cnt {
      align-items: center;
      display: flex;
      justify-content: center;
      position: relative
    }

    .pl__ctr {
      align-items: center;
      bottom: 0;
      display: flex;
      height: 50px;
      position: absolute;
      width: 100%
    }
